import React, {Component} from 'react';

class Photo extends Component {
    render(){
      //const post = this.props.post;
      return(

          <figure className="figure">
            <img className="photo" src = {this.props.post.imageLink} alt = {this.props.post.description}></img>
            <figcaption><p>{this.props.post.description}</p></figcaption>
            <div className="button-container">
                <button className="remove-bottom" onClick = { () => {
                    this.props.post.onRemovePhoto
                }}>Remove</button>
            </div>
          </figure>
      );
    }
  }

export default Photo;
